import { Footer } from 'antd/lib/layout/layout'
import React,{FC, ReactNode} from 'react'
import { Route } from 'react-router-dom'
import FooterHome from '../../pages/_Components/FooterHome/FooterHome'
import HeaderHome from '../../pages/_Components/HeaderHome/HeaderHome'
import Header from './Layout/Header/Header'

type Props = {
  component: any,
  mobileComponent?: (props:any) => React.FC<Props>
  path:string

}

export default function HomeTemplates(props: Props) {
  return (
    <Route exact path={props.path} render={(propsRoute) => {
        return <>
          <Header  />
          <props.component  {...propsRoute}/>
          <Footer/>
        </>
    }}></Route> 
  )
}
